public static ListNode rotateRight(ListNode head, int k) {
        if (head == null || head.next == null || k == 0){
            return head;
        }
        ListNode l = head;
        int max = 1;
        while (l.next != null){
            l = l.next;
            max++;
        }
        // 
        int f = k % max;
        if (f == 0){
            return head;
        }
        // 
        l.next = head;
        ListNode end = head;
        // 
        while (++f < max){
            end = end.next;
        }
        ListNode re = end.next;
        end.next = null;
        return re;
    }
